<template>
  <!-- 监测预警 -->
  <div class="early-warn">
    <div class="title">
      <div class="model-title">监测预警</div>
      <div class="update-time time-box">
        更新时间：{{ moment(new Date()).format("YYYY-MM-DD HH:mm:ss") }}
      </div>
    </div>
    <!-- 预警数 -->
    <div class="warnNumber">
      <div class="early-desc">
        <div
          class="block"
          v-for="(item, keys) in classifyWarning"
          :key="item.sid"
        >
          <p>{{ item.name }}</p>
          <div
            :class="[['', 'div-green', 'div-red'][keys]]"
            :style="{ color: ['#0084e9','#01ffff', '#e8395d'][keys] }"
          >
            {{ item.num }}
          </div>
        </div>
      </div>
    </div>
    <!-- 预警监测信息 -->
    <div class="early-form">
      <div class="common-table-box">
        <div class="model-little-title">预警监测信息</div>
        <div class="table-list">
          <Table :columns="columns" :listData="monitor">
            <template slot="content" slot-scope="{ record, text, index }">
              <p
                :style="{
                  cursor: index % 2 == 0 ? 'pointer' : '',
                  color: index % 2 == 0 ? 'rgb(2,186,194)' : '',
                }"
                @click="seeImg(index)"
              >
                {{ text }}
                <a-icon type="picture" v-if="index % 2 == 0" />
              </p>
            </template>
          </Table>
        </div>
      </div>
    </div>

    <!-- 警示信息 -->
    <div class="model-little-title">警示信息</div>
    <div class="warn-tip">
      <div class="tip-title">全国自然灾害综合风险预警提示</div>
      <div class="warn-desc">
        {{ warnTips }}
      </div>
    </div>
    <pop-up-layer
      :show="show"
      :setStyles="{ left: '25.5%', top: '50%' }"
      @doClose="close"
      opsition="pageRight"
      ref="myPopUpLayer"
      title="预警内容"
      class="img-pop"
    >
      <template slot="content">
        <img
          src="data:image/jpg;base64,"
          alt=""
        />
      </template>
    </pop-up-layer>
  </div>
</template>
<script>
import moment from "moment";
import Table from "@/components/APicture/c-table.vue";
import * as api from "@/api/hazardousChemicals";
import { Loading } from "element-ui";
export default {
  components: {
    Table,
  },
  data() {
    return {
      columns: [
        { textIndex: "warningObject", title: "预警对象", width: "20%" },
        { textIndex: "warning", title: "预警项", width: "14%" },
        { textIndex: "content", title: "预警内容", width: "42%" },
        { textIndex: "warningReceiver", title: "预警接收人", width: "12%" },
        { textIndex: "warningTime", title: "预警时间", width: "14%" },
      ],
      defaultParams: {
        body: {},
        page: 1,
        pageSize: 20,
        sortName: "sid",
        sortOrder: "desc",
      },
      classifyWarning: [],
      monitor: [],
      warnTips: "",
      show: false,
      imgList: null, //预警图片
    };
  },
  computed: {
    pushData() {
      return this.$store.getters.responeData;
    },
  },
  watch: {
    pushData: {
      handler(newVal, oldVal) {
        // console.log('testssss',newVal)
        if (newVal.cmd) {
          let cmdCode = newVal.cmd;
          switch (cmdCode) {
            case "rmGWpexI":
              this.getClassifyWarning();
              break;
            case "qWEtyhfg":
              this.getMonitor();
              break;
            default:
              break;
          }
        }
      },
      deep: true,
    },
  },
  created() {
    this.getMonitor();
    this.getClassifyWarning();
    this.getWarnTips();
    this.getWarnImg();
  },
  mounted() {},
  methods: {
    moment,
    // 预警监测信息
    getMonitor() {
      api.getMonitor(this.defaultParams).then((res) => {
        if (res.success) {
          res.body.data.map((e, i) => {
            if (i % 2 == 0) {
              e.content = "预警图片";
            } else {
              e.content = e.warningContent;
            }
          });
          this.monitor = res.body.data;
        } else {
          console.error(res.message);
        }
      });
    },
    // 分类预警数统计
    getClassifyWarning() {
      api.getClassifyWarning(this.defaultParams).then((res) => {
        if (res.success) {
          this.classifyWarning = res.body.data;
        } else {
          console.error(res.message);
        }
      });
    },
    // 警示信息
    getWarnTips() {
      api.getWarnTips(this.defaultParams).then((res) => {
        if (res.success) {
          this.warnTips = res.body.data[0].content;
          console.log(res.body.data, "res.body.data");
        } else {
          console.error(res.message);
        }
      });
    },
    //获取预警图片
    getWarnImg() {
      api.finHidentImg().then((res) => {
        if (res.success) {
          // this.imgList = res.body.picStr
        }
      });
    },
    close() {
      this.show = false;
    },
    //查看预警图片
    seeImg(i) {
      if (i & (1 != 0)) return;
      this.show = true;
      this.getWarnImg();
    },
  },
};
</script>

<style lang="less" scoped>
@import "../index.less";
</style>
